class Home extends Component {
  constructor(props) {
    super(props);

}

  render() {
    return(

      <div className="User">
        {this.state.user? (<Home/>) : (<Login/>)}

        <User firebase={firebase} setUser={this.setUser} />
      </div>

  );
}
}

export default Home;
